//SPDX-License-Identifier: UNLICENSED

pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract IPLAuction is ERC721 {

    address payable public auctioner;
    uint256 public numPlayers;
    uint256 public numTeams;

    // Phases will be set only by external agents and not by time "now"
    // Enum-uint mapping:
    // Started - 0; Ended - 1
    enum Phase {Started, Ended}

    Phase public currentPhase = Phase.Started;

    modifier onlyAuctioner() {
        require(msg.sender == auctioner, "onlyAuctioner");
        _;
    }

    struct Player {
        string name;
        uint256 baseRate;
        uint256 highestBid;
        uint256 runs;
        uint256 wickets;
        uint256 catches;
        address payable highestBidder;
        uint256 tokenId;
    }

    struct Team {
        string name;
        address payable owner;
        mapping(uint256 => Player) players;
    }

    mapping(uint256 => Player) public players;
    mapping(uint256 => Player) public soldPlayers;
    uint256 public soldPlayerCount;
    mapping(uint256 => Player) public unsoldPlayers;
    uint256 public unsoldPlayerCount;
    mapping(uint256 => Team) public teams;

    event AuctionStarted();
    event PlayerAdded(uint256 playerId, string name, uint256 basePrice);
    event TeamCreated(string teamName, address owner);
    event PlayerSold(uint256 playerId, string playerName, uint256 highestBid, address buyer);
    event AuctionEnded();

    constructor() ERC721("IPLAuction", "IPL") {
        auctioner = payable(msg.sender);
        numPlayers = 0;
        numTeams = 0;
        soldPlayerCount = 0;
        unsoldPlayerCount = 0;
    }

    function createTeam(string memory team_name, address ownerAddr) public {
        require(msg.sender == auctioner, "Only auctioner can create team");

        teams[numTeams].name = team_name;
        teams[numTeams].owner = payable(ownerAddr);

        emit TeamCreated(team_name, msg.sender);
        numTeams++;
    }

    function addPlayer(
        string memory _name,
        uint256 _baseRate,
        uint256 _runs,
        uint256 _wickets,
        uint256 _catches
    ) public {
        require(msg.sender == auctioner, "Only auctioner can add a player");
        // tokenId = numPlayers
        players[numPlayers] = Player(
            _name,
            _baseRate,
            0,
            _runs,
            _wickets,
            _catches,
            payable(msg.sender),
            numPlayers
        );
        _mint(msg.sender, numPlayers);
        emit PlayerAdded(numPlayers, _name, _baseRate);
        numPlayers++;
    }

    function updatePlayer(
        uint256 _playerId,
        uint256 _runs,
        uint256 _wickets,
        uint256 _catches,
        uint256 _baseRate,
        uint256 _highestBid
    ) public {
        require(msg.sender == auctioner, "Only auctioner can edit a player");
        players[_playerId].runs = _runs;
        players[_playerId].wickets = _wickets;
        players[_playerId].catches = _catches;
        players[_playerId].baseRate = _baseRate;
        players[_playerId].highestBid = _highestBid;
        // Emit an event
    }

    function advancePhase() public onlyAuctioner {
        // If already in done phase, reset to init phase
        if (currentPhase == Phase.Ended) {
            currentPhase = Phase.Started;
        } else {
            currentPhase = Phase.Ended;
        }

        // Emit appropriate events for the new phase
        if (currentPhase == Phase.Started) emit AuctionStarted();
        if (currentPhase == Phase.Ended) emit AuctionEnded();
    }

    function placeBid(uint256 _playerId) public payable {
        require(_playerId < numPlayers, "Player does not exist");
        require(
            msg.value > players[_playerId].baseRate,
            "Bid amount should be greater than the current highest bid"
        );

        if(msg.value > players[_playerId].highestBid)
        {
            // Update the highest bidder for this player
            players[_playerId].highestBidder = payable(msg.sender);
            players[_playerId].highestBid = msg.value;
        }
    }

    function auctionEnd() public onlyAuctioner {
        // Transfer the player to the highest bidder
        for (uint256 i = 0; i < numPlayers; i++) {
            address highestBidder = players[i].highestBidder;
            transferFrom(msg.sender, highestBidder, players[i].tokenId);

            if (players[i].highestBid != 0) {
                soldPlayers[soldPlayerCount] = players[i];
                soldPlayerCount++;
            } else {
                unsoldPlayers[unsoldPlayerCount] = players[i];
                unsoldPlayerCount++;
            }
        }
        advancePhase();
    }

}
